import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { restaurantApi } from './api/restaurantApi';
import { useAuth } from '../contexts/AuthContext';

const OwnerDashboard = () => {
    const [myRestaurants, setMyRestaurants] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState('');
    const { logout } = useAuth();
    const navigate = useNavigate();

    useEffect(() => {
        fetchOwnerRestaurants();
    }, []);

    const fetchOwnerRestaurants = async () => {
        try {
            const data = await restaurantApi.getOwnerRestaurants();
            setMyRestaurants(data);
        } catch (err) {
            setError('Failed to fetch your restaurants');
        } finally {
            setLoading(false);
        }
    };

    const handleAddRestaurant = () => {
        navigate('/add-restaurant');
    };

    const handleLogout = () => {
        logout();
        navigate('/login');
    };

    if (loading) {
        return <div className="flex justify-center items-center h-screen">Loading...</div>;
    }

    return (
        <div className="min-h-screen bg-gray-100">
            <nav className="bg-white shadow-lg">
                <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
                    <div className="flex justify-between h-16">
                        <div className="flex items-center">
                            <h1 className="text-xl font-bold">Restaurant Owner Dashboard</h1>
                        </div>
                        <div className="flex items-center space-x-4">
                            <button
                                onClick={handleAddRestaurant}
                                className="px-4 py-2 bg-green-600 text-white rounded-md hover:bg-green-700"
                            >
                                Add New Restaurant
                            </button>
                            <button
                                onClick={handleLogout}
                                className="px-4 py-2 bg-red-600 text-white rounded-md hover:bg-red-700"
                            >
                                Logout
                            </button>
                        </div>
                    </div>
                </div>
            </nav>

            <main className="max-w-7xl mx-auto py-6 sm:px-6 lg:px-8">
                {error && (
                    <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded mb-4">
                        {error}
                    </div>
                )}

                <div className="mb-6">
                    <h2 className="text-2xl font-bold text-gray-900">My Restaurants</h2>
                </div>

                <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
                    {myRestaurants.map((restaurant) => (
                        <div key={restaurant.id} className="bg-white overflow-hidden shadow rounded-lg">
                            <div className="px-4 py-5 sm:p-6">
                                <h3 className="text-lg font-medium text-gray-900">
                                    {restaurant.name}
                                </h3>
                                <p className="mt-1 text-sm text-gray-600">
                                    {restaurant.description}
                                </p>
                                <div className="mt-4 space-y-2">
                                    <p className="text-sm text-gray-500">
                                        Cuisine: {restaurant.cuisineType}
                                    </p>
                                    <p className="text-sm text-gray-500">
                                        Price Range: {restaurant.priceRange}
                                    </p>
                                    <p className="text-sm text-gray-500">
                                        Address: {restaurant.address}
                                    </p>
                                </div>
                                <div className="mt-4">
                                    <button
                                        onClick={() => navigate(`/restaurant/${restaurant.id}/reviews`)}
                                        className="text-indigo-600 hover:text-indigo-900"
                                    >
                                        View Reviews
                                    </button>
                                </div>
                            </div>
                        </div>
                    ))}
                </div>

                {myRestaurants.length === 0 && (
                    <div className="text-center text-gray-500 mt-4">
                        You haven't added any restaurants yet.
                    </div>
                )}
            </main>
        </div>
    );
};

export default OwnerDashboard;
